INSERT INTO t_e_accessoire_acs(cat_id, mar_id, acs_nom, acs_prix, acs_description)
VALUES (8, 153, 'Chaîne Kryptonite New York 1217 (170cm)', 226,
        'Antivol Chaîne avec Cadenas : sécurité Maximale pour Votre vélo Chaîne ultra-résistante : Notée 9/10 sur l''échelle Krytponite en matière de sécurité, la Chaîne dispose de maillons hexagonaux de 12 mm en acier manganèse 3T pour une résistance maximale.Protection renforcée : Gaine en nylon résistante avec fermeture Velcro pour maintenir la Chaîne en place et protéger votre vélo.Cadenas haute sécurité : Cadenas pour disque Evolution Série 4 avec anse en acier de 14 mm et fût oval en acier trempé breveté pour plus de sécurité.Détails pratiques : Couvercle anti-possière coulissant pour prolonger la durée de vie du cylindre, 3 clés en acier inoxydable dont une avec ampoule haute intensité et pile remplaçable.Programme Key Safe : Pour un remplacement facile des clés.Dimensions et cav_poids : Chaîne de 170 cm de longueur, anse de 14 mm de diamètre, cav_poids de 5,96 kg.');
INSERT INTO t_e_accessoire_acs(cat_id, mar_id, acs_nom, acs_prix, acs_description)
VALUES (8, 153, 'Chaîne Kryptonite New York Legend 1515 (150cm)', 279, 'Antivol Kryptonite New York Legend 1515 : Protection Ultime pour Votre vélo

sécurité maximale : Noté 10/10, cet antivol est idéal pour protéger votre vélo dans les environnements urbains à haut risque et pour les stationnements nocturnes.

Chaîne robuste : Maillons de 15 mm en acier trempé 3T, avec une longueur de 1,50 m, permettant d''attacher à la fois le cadre et les roues.

Cadenas haute sécurité : Cadenas New York Padlock avec cylindre renforcé de 16 mm et double verrouillage pour une résistance accrue contre les tentatives de torsion.

Protection pratique : Chaîne recouverte de nylon pour éviter l''abrasion et protéger votre vélo.

Inclus avec l''antivol : Livré avec 3 clés dont une avec LED, pour une utilisation facile même dans l''obscurité.

idéal pour vélos de valeur : Recommandé pour les vélos électriques, cargos, bi et tri-porteurs dans des zones à risque.

