INSERT INTO t_e_accessoire_acs(cat_id, mar_id, acs_nom, acs_prix, acs_description)
VALUES (8, 151, 'Antivol pliable Abus Bordo 6000k/90cm', 89, 'Faites confiance à la qualité du classique: l''antivol pliable BORDOé 6000K offre une bonne protection contre le vol tout en étant extrémement pratique avec sa longeur d''attache et son gabarit compact replié.

