- Connexion des barres par des rivets spéciaux');
INSERT INTO t_e_accessoire_acs(cat_id, mar_id, acs_nom, acs_prix, acs_description)
VALUES (8, 155, 'Antivol de roue arriére AXA Defender (cav_pneus < 50mm)', 35, 'L''antivol de cadre Defender d''AXA est un antivol classique largement apprécié pour sa robustesse et sa sécurité. Une fois fixé au cadre, il vous permet d''effectuer des arréts minute en bloquant directement votre roue arriére. Pour plus de sécurité si vous prévoyez un temps d''arrét prolongé, il est impératif d''accrocher votre vélo à un point fixe : c''est pourquoi nous vous recommandons de combiner le Defender avec une Chaîne AXA RLC Plus de 100 cm ou de 140 cm.

Niveau de protection
Niveau "2 roues" sur l''échelle de la FUB et 12/15 par AXA : il est agréé par notre partenaire assureur Evy si vous choisissez de protéger votre vélo contre le vol. Toutefois, vous devez l''utiliser combiné à une Chaîne AXA RLC Plus car votre vélo doit étre attaché à un point fixe pour étre couvert par votre contrat d''assurance.

Compatibilité ??
L''antivol de cadre AXA Defender est compatible avec des cav_pneus de largeur inférieure à 50mm. Pour connaétre la largeur des cav_pneus d''un vélo électrique, vous pouvez vous référer aux indications de cav_pneus sur la fiche produit. Les deux premiers chiffres du code à 5 chiffres (appelé ETRTO) correspondent à la largeur du pneu. Par exemple, un vélo avec la mention "47-622" aura des cav_pneus de 47 mm de largeur, donc compatibles avec l''antivol AXA Defender. Si les cav_pneus sont plus larges, nous vous recommandons la référence AXA Defender XXL.

Spécifications techniques
- Notice de montage
- Instructions vidéo
- Dimensions : 16 cm x 14 cm
- cav_poids : 720 gr
- Livré avec deux clés
- Vis non fournies');
INSERT INTO t_e_accessoire_acs(cat_id, mar_id, acs_nom, acs_prix, acs_description)
VALUES (8, 155, 'Chaine AXA RLC Plus 140cm', 35, 'La Chaîne AXA RLC Plus 140 s''utilise uniquement en combinaison avec un antivol de cadre AXA Fusion, Victory, Defender et Solid Plus pour une sécurité supplémentaire lors du verrouillage de votre vélo. Elle permet de verrouiller votre vélo à un objet fixe tel qu''un lampadaire ou une cléture. En une seule opération, votre vélo est verrouillé par 2 antivols.

Compatibilité assurance
La Chaîne AXA RLC n''est pas compatible avec notre assurance vol et dommages accidentels. Si vous souhaitez utiliser une Chaîne, les anneaux doivent faire plus de 7mm de diamètre. En savoir plus sur les accessoires compatibles.

Compatibilité avec l''antivol de cadre
La Chaîne est uniquement utilisable en combinaison avec un antivol de cadre AXA Defender.
Attention : cette chaine n''est pas compatible avec le Axa Block XXL.

Caractéristiques techniques
- Longueur : 140 cm
- diamètre des anneaux : 5,5cm');
INSERT INTO t_e_accessoire_acs(cat_id, mar_id, acs_nom, acs_prix, acs_description)
