L''antivol de Cadre Block d''AXA est un antivol classique largement apprécié pour sa robustesse et sa sécurité. Une fois fixé au cadre, il vous permet d''effectuer des arréts minute en bloquant directement votre roue arriére. Pour plus de sécurité si vous prévoyez un temps d''arrét prolongé, il est impératif d''accrocher votre vélo à un point fixe.


Compatibilité ??
L''antivol de cadre AXA Block est compatible avec des cav_pneus de largeur comprise entre 50 et 60mm. Pour connaétre la largeur des cav_pneus d''un vélo électrique, vous pouvez vous référer aux indications de cav_pneus sur la fiche produit. Les deux premiers chiffres du code à 5 chiffres (appelé ETRTO) correspondent à la largeur du pneu. Par exemple, un vélo avec la mention "50-622" aura des cav_pneus de 50 mm de largeur, donc compatibles avec l''antivol AXA Block XXL. Si les cav_pneus sont moins larges, nous vous recommandons la référence AXA Defender.


Caractéristiques techniques
Dimensions : 16 cm x 15 cm
cav_poids : 720 gr
Livré avec deux clés
Instructions de montage
Vis non fournies');
INSERT INTO t_e_accessoire_acs(cat_id, mar_id, acs_nom, acs_prix, acs_description)
VALUES (9, 154, 'Sacoche Ortlieb Back-Roller Classic - Asphalet & Black', 129, 'La référence ultime de sacoches imperméables pour porte bagage-arriére. Les sacoches Back Roller Classic sont idéales pour tous les adeptes de grandes randonnées à vélo. Elles sont le bagage indispensable pour transporter vos affaires sur le porte bagage arriére de votre vélo, à l''abri des intempéries et de la possière. Céest la toile en polyester robuste et le systéme de fermeture hermétique par enroulement qui assurent imperméabilité de la sacoche Back Roller Classic. équipée du systéme de fixation Ortlieb Quick-Lock 2.1, la sacoche Back Roller Classic séinstalle et se désinstalle rapidement et facilement sur votre porte-bagages. Son systéme de crochets autobloquants via une poignée au dos de la sacoche permet déaccrocher sa sacoche à une main en quelques secondes. Informations techniques :
- Sacoches vendues par paire
