INSERT INTO t_e_accessoire_acs(cat_id, mar_id, acs_nom, acs_prix, acs_description)
VALUES (9, 156, 'Sacoche de guidon/banane Restrap Utility Hip Pack', 113,
        'Utility Hip Pack Restrap : Polyvalent et Conéu pour l''Aventure. Polyvalence ultime : Ce sac est à la fois une banane et un sac de guidon, offrant une fonctionnalité sans compromis dans les deux configurations. Les sangles de taille se replient pour transformer le sac en un sac de guidon pratique, avec un systéme de fixation rapide et un systéme de retenue pour le tube de direction. Confort ergonomique : Adapté à diverses morphologies, il assure un ajustement confortable et sécurisé Grâce à son systéme de rétention réglable qui minimise les mouvements et maximise la stabilité lors des longues sorties. Protection contre les intempéries : Le sac est doté d''une fermeture roulée et d''un compartiment interne entiérement étanche avec des coutures scellées, gardant vos affaires au sec quelles que soient les conditions. Accés facile et rapide : La fermeture magnétique Fidlock garantit une ouverture et une fermeture simples tout en maintenant une étanchéité sécurisée. Les poches latérales en mesh extensible offrent un accés rapide à vos essentiels comme les barres énergétiques ou les bouteilles d''eau. Détails réfléchissants : Pour une meilleure visibilité en conditions de faible luminosité. Fabriqué à la main : Fini avec le label Restrap en cuir PU respectueux des animaux. cav_poids : 361g | Capacité : 6L');
