INSERT INTO t_e_accessoire_acs(cat_id, mar_id, acs_nom, acs_prix, acs_description)
VALUES (10, 157, 'Casque Bern Macon 2.0 (Large)', 69, 'Un casque à prix trés doux, un confort optimal, une polyvalence remarquable et une sécurité accrue : voilé ce que propose le casque Macon de la marque Bern. Avec lui, vous réalisez vos trajets maison - travail sans risquer le coup de chaud et vous oubliez même qu''il est sur votre tête.

