INSERT INTO t_e_accessoire_acs(cat_id, mar_id, acs_nom, acs_prix, acs_description)
VALUES (10, 157, 'Casque Bern FL-1 Libre (Small)', 79, 'Le casque vélo Bern FL-1 Libre est un modéle passe-partout, assez sportif et trés polyvalent. Sa structure ajourée, qui compte 18 ouvertures, offre un niveau de ventilation supérieur à la moyenne. La coque in-mold est composée d''une ent_e_velo_velppe en PC thermoformé et d''une couche EPS (polystyréne expansé).

Certifié CPSC et EN1078, le casque vélo Bern FL-1 Libre est un modéle particuliérement léger (253 grammes). Disponible en 3 tailles, il s''ajuste facilement sur votre tour de tête en manipulant la molette CrankFit.

Points forts :

- La coque légére et bien ventilée
- La construction in-mold trés résistante
- Un style polyvalent

Tailles du casque :

- Small : Tour de tête de 52 à 55,5 cm
- Medium : Tour de tête de 55,5 à 59 cm
- Large : Tour de tête de 59 à 62 cm

Pour mesurer la circonférence de votre tête, utilisez un métre ruban (ou une ficelle). Positionnez-le horizontalement au-dessus des oreilles et au milieu du front, à environ 2 centiméres de hauteur par rapport à vos sourcils. Relevez ensuite la mensuration sur le métre.');
