INSERT INTO t_e_accessoire_acs(cat_id, mar_id, acs_nom, acs_prix, acs_description)
VALUES (10, 157, 'Casque Bern Hudson MIPS (Small)', 158, 'Le casque de ville par excellence
Avec un look inspiré d''un du baseball, ce casque est parfaitement adapté pour vos trajets quotidiens. Ent_e_velo_velppant, fiable et répondant aux normes de sécurité les plus élevées, y compris la norme NTA 8776 relative aux speed bikes, il garantit une protection maximale et un confort accru pour les escapades en ville ou à la campagne. Le serrage micrométrique Compass Fit génére en paralléle une excellente tenue sur la tête !

La différence Mips
Le casque Bern Hudson dispose de la technologie MIPS et sa coque révolutionnaire qui accroit la protection de la tête en cas de chocs obliques. En diffusant l''énergie de l''impact, le cycliste bénéficie d''une réduction drastique des risques de commotion faisant de cette protection un allié indispensable pour toutes les sorties. En paralléle, la mousse spécifique inclut une absorption des chocs plus efficiente. Avec cet ensemble, c''est 30% de sécurité en plus par rapport à un moulage classique !

sécurité, lumiére et ventilation
La coque ronde de ce casque assure une trés haute protection de la nuque et des tempes tout en intégrant le nécessaire pour les trajets de nuit. A l''arriére, on retrouve une lumiére LED et ses 3 modes dont l''autonomie remarquable (jusqu''é 10h) et les effets flash collent parfaitement aux besoins de la ville. Par ailleurs, la structure dispose de 13 évents de ventilation qui créent des canaux d''air frais tout autour du cuir chevelu. Un effet agréable pour les temps chauds de l''été !

Tailles du casque

- Small : Tour de tête de 52 à 55,5 cm
- Medium : Tour de tête de 55,5 à 59 cm
- Large : Tour de tête de 59 à 62 cm

Pour mesurer la circonférence de votre tête, utilisez un métre ruban (ou une ficelle). Positionnez-le horizontalement au-dessus des oreilles et au milieu du front, à environ 2 centiméres au-dessus de vos sourcils. Relevez ensuite la mensuration sur le métre.');
