sécurité, lumiére et ventilation
La coque ronde de ce casque assure une trés haute protection de la nuque et des tempes tout en intégrant le nécessaire pour les trajets de nuit. A l''arriére, on retrouve une lumiére LED et ses 3 modes dont l''autonomie remarquable (jusqu''é 10h) et les effets flash collent parfaitement aux besoins de la ville. Par ailleurs, la structure dispose de 13 évents de ventilation qui créent des canaux d''air frais tout autour du cuir chevelu. Un effet agréable pour les temps chauds de l''été !

Tailles du casque

- Small : Tour de tête de 52 à 55,5 cm
- Medium : Tour de tête de 55,5 à 59 cm
- Large : Tour de tête de 59 à 62 cm

Pour mesurer la circonférence de votre tête, utilisez un métre ruban (ou une ficelle). Positionnez-le horizontalement au-dessus des oreilles et au milieu du front, à environ 2 centiméres au-dessus de vos sourcils. Relevez ensuite la mensuration sur le métre.');
INSERT INTO t_e_accessoire_acs(cat_id, mar_id, acs_nom, acs_prix, acs_description)
VALUES (11, 159, 'Siège Qibbel Junior 6+ (Noir)', 90, 'Qibbel Junior 6+, le Siège enfant robuste pour les plus grands. Conéu pour les enfants de 6 ans et plus : Ce Siège arriére est parfait pour les enfants jusqu''é 35 kg. Assurez-vous que votre porte-bagages peut supporter ce cav_poids.

sécurité renforcée : Le Qibbel Junior 6+ est équipé d''une ceinture de sécurité à trois points et de repose-pieds pliables pour garantir la sécurité de votre enfant lors de chaque trajet.

Confort maximal : Grâce à son coussin moelleux, votre enfant sera à l''aise pendant toute la balade.

Installation rapide et facile : Pas besoin d''outils pour installer ce Siège arriére. Il s''adapte aux porte-bagages de 11 à 17 cm de large avec des tubes de 10 à 22 mm de diamètre. Un insert est fourni pour les tubes plus fins.

Avec le Qibbel Junior 6+, offrez à votre enfant un trajet en toute sécurité et confort !');
INSERT INTO t_e_accessoire_acs(cat_id, mar_id, acs_nom, acs_prix, acs_description)
VALUES (11, 159, 'Siège Enfant Qibbel Air (Silver)', 125, 'Le Siège enfant arriére le plus léger pour votre vélo

Confort et légéreté : Le Qibbel Air est conéu pour les enfants de 9 mois à 6 ans (jusqu''é 22 kg). Grâce à son dossier en mesh, un matériau léger, résistant et ventilé, votre enfant est confortablement installé dans un Siège qui ne pése que 2,5 kg.

sécurité maximale : La sécurité de votre enfant est notre priorité. Le Siège Qibbel Air respecte les normes de sécurité européennes strictes et a obtenu une certification TéV en Allemagne. Chaque Siège est rigoureusement testé pour vous offrir une tranquillité d''esprit totale.

Installation facile : Le Siège s''adapte aux porte-bagages de 11 à 17 cm de large, capables de supporter au moins 27 kg (n''hésitez pas à nous contacter pour savoir si le modéle qui vous intéresse dispose d''un tel porte-bagage). Si votre vélo n''a pas de porte-bagages, une fixation sur le cadre est possible, séadaptant aux cadres de 28 à 40 mm de diamètre.

Avec le Qibbel Air, emmenez votre enfant partout en toute sécurité et avec facilité !');
