INSERT INTO t_e_accessoire_acs(cat_id, mar_id, acs_nom, acs_prix, acs_description)
VALUES (12, 153, 'Lumiére avant Kryptonite Incite X6', 72, 'La lampe avant Kryptonite Incite X6 est conéue pour offrir une visibilité optimale avec une puissance lumineuse de 60 lux, assurant une excellente visibilité pour le cycliste en toutes conditions, y compris sur des routes non éclairées. Grâce à sa technologie double optique de haute qualité, le faisceau lumineux est précis, illuminant efficacement la route sans éblouir les autres usagers. Capteur de Luminosité : équipée d''un capteur qui ajuste automatiquement la luminosité en fonction de la lumiére ambiante pour une visibilité optimale.
Modes d''éclairage : automatique, intense, moyen, faible, jour, nuit, flash
Autonomie : Entre 3 et 30 heures, selon le mode sélectionné. La batterie se recharge via USB et un signal lumineux alerte lorsque la batterie est à moins de 20% de charge.
Visibilité Latérale : Fentes sur les cétés du feu pour améliorer la visibilité latérale du cycliste.

Support : Inclus avec le support sur guidon vélo, compatible avec la plupart des diamètres de cintre Grâce à une bande ajustable.

Détachable : La lampe peut étre retirée du support pour un rangement pratique et pour éviter les risques de vol lorsque vous ne roulez pas.');
INSERT INTO t_e_accessoire_acs(cat_id, mar_id, acs_nom, acs_prix, acs_description)
VALUES (12, 153, 'Paire d''éclairages Kryptonite Avenue F-100 COB / R-50 COB', 65, 'Cette paire d''éclairage proposée par Kryptonite vous garantie une haute visibilité Grâce à ses éclairages puissants et sa haute autonomie (jusqu''é 22h) sans faire de concession sur la facilité d''utilisation Grâce aux différents modes et à la recharge USB

Informations techniques:
- Avenue F-100 COB : Modes inclus Fixe intense, Fixe Moyen, Fixe Faible, Flash de jour, Flash de nuit, Flash économique
- Avenue R-50 COB : Modes inclus Fixe intense, Fixe Moyen, Fixe Faible, Flash de jour, Flash de nuit, Flash économique
- 100% Rechargeable USB
- Temps d''utilisation jusquéé 22 h 30 (Avenue F-100 COB) et 11 h 15 (Avenue R-50 COB)
- Fonction de mémoire- la lumiére s''allume au dernier mode au moment de la fermeture
- Fonction dééconomie déénergie à é 10 % déénergie ou moins, le rendement lumineux de lééclairage passera automatiquement à un niveau plus faible
- Voyant déétat de la batterie intégré : lumiére rouge = moins de 25 % et lumiére verte = entiérement chargée');
INSERT INTO t_e_accessoire_acs(cat_id, mar_id, acs_nom, acs_prix, acs_description)
VALUES (12, 153, 'Lumiére avant Krytponite Alley F-800', 75, 'Pour les trajets nocturnes et les routes non éclairées, optez pour cet éclairage LED rechargeable puissant. Conéu pour assurer une excellente visibilité en pleine campagne comme en milieu urbain, cet éclairage vous permet de voir clairement la chaussée et déétre bien vu par les autres usagers de la route.

Puissance : Jusquéé 800 Lumens pour une visibilité accrue en toutes conditions.

Autonomie : Profitez de jusqu''é 24 heures d''éclairage selon le mode utilisé.

Recharge : LED 100% rechargeable via USB, sans batterie à remplacer.

Orifices dééclairage latéraux : Améliorent la visibilité latérale du cycliste.

Fonction de mémoire : Se souvient du dernier mode utilisé lors de la fermeture.

Cet éclairage LED est idéal pour assurer votre sécurité et visibilité lors de vos sorties nocturnes ou par conditions climatiques défavorables.');
