- coa_contenu énergétique (Wh) : 625 Wh
- Dimensions : 416 x 84 x 65 mm

Produit expédié par notre partenaire Doctibike');
INSERT INTO t_e_accessoire_acs(cat_id, mar_id, acs_nom, acs_prix, acs_description)
VALUES (14, 160, 'Star BluBike Spray Chain Cleaner - 400ml', 10, 'CHAIN CLEANER : Nettoyez votre Chaîne de vélo en profondeur, sans compromis pour votre cadre.

Le spray dégraissant CHAIN CLEANER nettoie efficacement et dégraisse rapidement la Chaîne de vélo. Il est conéu pour ne pas endommager la peinture, les piéces en plastique ou en fibre de carbone.

Produit inflammable. à utiliser à l''écart de toute source de flamme nue. Aprés chaque nettoyage, appliquez soigneusement un nouveau lubrifiant.');
INSERT INTO t_e_accessoire_acs(cat_id, mar_id, acs_nom, acs_prix, acs_description)
VALUES (14, 160, 'Star BluBike Pack Bio Chain Kit Blister', 31, 'Kit de nettoyage de Chaîne écologique avec lubrifiant Bio-Lube (75 ml), dégraissant Bio Chain Cleaner (250 ml) et dispositif de nettoyage de Chaîne.

Bio Lube est un excellent lubrifiant naturel, biodégradable à plus de 95%, parfait pour graisser les Chaînes et autres parties de votre vélo. Il protége également les piéces métalliques contre la rouille et l''usure, quel que soit le temps.

Bio Chain Cleaner est un dégraissant liquide à base d''extraits naturels, aussi biodégradable à plus de 95%. idéal pour les Chaînes de vélo et les piéces lubrifiées à l''huile ou à la graisse, il se transforme naturellement en substances non toxiques qui respectent l''environnement. Si conservé dans son emballage d''origine, il conserve ses propriétés de nettoyage pendant deux ans.');
INSERT INTO t_e_accessoire_acs(cat_id, mar_id, acs_nom, acs_prix, acs_description)
VALUES (14, 161, 'Pompe à pied acier noir P&A', 20, 'La pompe à pied en acier Noir avec manométre de la marque P&A sera un outil indispensable, d''un excellent rapport qualité / prix, elle vous permettra de gonfler les cav_pneus de votre vélo facilement et rapidement.

Caractéristiques:
- Double embouts presta/schrader
- Manométre Bars/PSI
- Gonflage jusqu''é 11 bars
- Poignée ergonomique et confortable de cav_couleur assortie à la pompe
- Hauteur pompe: 64cm');
INSERT INTO t_e_accessoire_acs(cat_id, mar_id, acs_nom, acs_prix, acs_description)
VALUES (14, 160, 'Star BluBike Spray Huile Silicon - 200ml', 7, 'Silicon Spray : Protection avancée pour tous les composants de votre vélo.

Le spray lubrifiant de haute qualité pour vélo, Silicon Spray, est spécialement conéu pour protéger les parties métalliques, en carbone et en plastique contre la saleté et l''eau.

Silicon Spray laisse un film protecteur qui facilite le nettoyage et assure le séchage des surfaces traitées. Il peut également étre utilisé pour lubrifier et protéger la Chaîne, les roulements et les cav_amortisseurs. Pour l''application, pulvérisez le produit sur les parties à traiter et essuyez avec un chiffon. Utilisez aprés chaque nettoyage pour redonner de la brillance à votre vélo.');
INSERT INTO t_e_accessoire_acs(cat_id, mar_id, acs_nom, acs_prix, acs_description)
VALUES (14, 160, 'Star BluBike Spray Bike Lube - 200ml', 9, 'BIKE LUBE PTFE : Performance maximale pour une transmission fluide et protégée.

Le lubrifiant de haute qualité pour vélo Bike Lube est formulé avec du PTFE et un additif spécial pour réduire les bruits et les frottements. Il améliore la fluidité des changements de vitesse des composants mécaniques tout en protégeant contre l''usure et l''oxydation.

BIKE LUBE PTFE pénétre facilement dans les maillons de la Chaîne, laissant un film non adhésif qui prévient l''accumulation de saletés. idéal pour une lubrification facile et rapide, ce produit offre une protection efficace pour votre vélo.');
INSERT INTO t_e_accessoire_acs(cat_id, mar_id, acs_nom, acs_prix, acs_description)
VALUES (14, 160, 'Star BluBike Huile Bio Lube - 75ml', 6, 'BIO LUBE : Lubrification écologique pour une performance durable de votre vélo.

Le lubrifiant biodégradable pour vélo BIO LUBE est un produit d''origine végétale, biodégradable à prés de 95%. Conéu pour lubrifier et protéger la Chaîne ainsi que les autres parties du vélo, BIO LUBE respecte l''environnement tout en offrant une protection efficace contre la rouille et la corrosion, quelles que soient les conditions extérieures.

Ce lubrifiant pour Chaîne est parfait pour les cyclistes soucieux de la nature et de l''environnement. Appliquez toujours le produit sur une Chaîne propre et nettoyez-la aprés avoir fait tourner le pédalier. évitez tout contact avec les cav_freins.');
INSERT INTO t_e_accessoire_acs(cat_id, mar_id, acs_nom, acs_prix, acs_description)
VALUES (14, 160, 'Star BluBike Dégraissant Chain Cleaner - 250ml', 6, 'CHAIN CLEANER : Dégraisseur sér et efficace pour des Chaînes impeccables

CHAIN CLEANER est un dégraissant moyennement volatile, non soluble dans l''eau et sans odeur, parfait pour nettoyer les Chaînes de vélo et toute piéce lubrifiée avec des huiles ou des graisses. Il est sér pour les piéces en plastique, en carbone et les peintures.

Pour nettoyer la Chaîne, utilisez un pinceau ou appliquez CHAIN CLEANER sur un dispositif prévu à cet effet, comme un nettoyeur de Chaînes. Utilisez un chiffon imbibé de CHAIN CLEANER pour dégraisser toutes les piéces lubrifiées. Aprés chaque nettoyage, assurez-vous de lubrifier soigneusement à nouveau les piéces.');
INSERT INTO t_e_accessoire_acs(cat_id, mar_id, acs_nom, acs_prix, acs_description)
VALUES (14, 160, 'Star BluBike Dégraissant Bio Chain Cleaner - 250ml', 7, 'BIO CHAIN CLEANER : Dégraissant naturel pour une Chaîne impeccable et un environnement préservé.

BIO CHAIN CLEANER est un dégraissant liquide d''origine végétale, biodégradable à plus de 95%. Il est parfait pour éliminer les huiles et graisses des Chaînes et autres parties de votre vélo. Ce produit se dégrade rapidement dans l''environnement sans laisser de résidus nocifs.

Pour nettoyer la Chaîne, utilisez un pinceau ou ajoutez BIO CHAIN CLEANER sur un dispositif prévu à cet effet, tel qu''un nettoyeur de Chaînes. Il conserve ses propriétés intactes pendant plus de deux ans s''il est conservé dans son emballage d''origine.');
INSERT INTO t_e_accessoire_acs(cat_id, mar_id, acs_nom, acs_prix, acs_description)
VALUES (14, 160, 'Star BluBike Bombe Gonfle et Répare TS-300 - 100mL', 7, 'TS-300 : Réparez et regonflez instantanément vos cav_pneus en toute simplicité.

Aérosol gonfleur et réparateur de vélo TS-300. Ce produit permet de regonfler et de réparer instantanément lors d''une crevaison.

Pour l''utiliser, fixez l''adaptateur sur la valve du pneu et gonflez jusqu''é ce que le trou soit complétement fermé. évitez tout contact avec des flammes ou des surfaces chaudes. Informez votre mécanicien de cette opération. Livré avec un adaptateur pour les valves Presta, Schrader et Regina.');
