INSERT INTO t_e_accessoire_acs(cat_id, mar_id, acs_nom, acs_prix, acs_description)
VALUES (16, 156, 'Casquette de cyctliste Restrap Yorkshire Contours (Orange)', 29, 'Casquette Yorkshire Dales : Un Hommage aux Paysages du Yorkshire

Design inspiré : Cette casquette est ornée des lignes de contour des vallées et collines des Yorkshire Dales, oé Restrap teste ses équipements.

Confort toute l''année : Fabriquée en mélange de coton et polyester, la casquette est à la fois coupe-vent et respirante, idéale pour toutes les saisons.

Maintien et fraécheur : Bande élastique antibactérienne pour un ajustement confortable et une sensation de fraécheur.

Taille unique : S''adapte à la plupart des tours de tête.');
