INSERT INTO t_e_accessoire_acs(cat_id, mar_id, acs_nom, acs_prix, acs_description)
VALUES (16, 164, 'The Peoples Poncho 3.0 (Bleu)', 75, 'Ne laissez plus la pluie gécher vos déplacements à vélo ! Le Poncho 3.0 de The People''s Poncho est conéu pour vous garder au sec, oé que vous soyez. Il incarne l''excellence en matière de vétements de pluie.

Caractéristiques
- Ceinture élastique empéchant toute envolée intempestive lors de vos déplacements.
- Capuche qui suit vos mouvements pour une visibilité optimale.
- Trois couches protectrices : imperméable, respirant, et confortable dans toutes les conditions.
- Poche avant imperméable pour vos essentiels et options de port en cape ou poncho avec manches.
- Les surpiqéres réfléchissantes ajoutent une touche de sécurité supplémentaire, assurant une visibilité accrue de nuit ou par mauvais temps.
- Compact et léger, il se range facilement dans sa pochette. Taille adulte : 130cm x 97cm, cav_poids 460g.');
