INSERT INTO t_e_contenu_article_coa(art_id, coa_prioritecontenu, coa_typecontenu, coa_contenu)
VALUES (3, 0, 'Titre', 'Qu''est-ce que le reconditionnement Upway ?');
INSERT INTO t_e_contenu_article_coa(art_id, coa_prioritecontenu, coa_typecontenu, coa_contenu)
VALUES (3, 1, 'coa_contenu',
        'Les vélos électriques Upway passent entre les mains de notre équipe de mécaniciens professionnels. De la batterie à la sonnette, rien n’est laissé au hasard afin que votre vélo soit livré dans un état aussi proche que possible du neuf. Notre processus de reconditionnement se déroule en 3 étapes : ');
INSERT INTO t_e_contenu_article_coa(art_id, coa_prioritecontenu, coa_typecontenu, coa_contenu)
