VALUES (3, 5, 'Li gras', 'Inspection du vélo en 20 points : ');
INSERT INTO t_e_contenu_article_coa(art_id, coa_prioritecontenu, coa_typecontenu, coa_contenu)
VALUES (3, 5, 'Li',
        'cette étape nous permet de vérifier qu’il n’existe aucun dégât structurel sur le cadre, les points de sécurité, la transmission, le moteur ou la batterie. Cela nous permet également de faire l’inventaire des réparations et remplacements de pièces à effectuer.');
INSERT INTO t_e_contenu_article_coa(art_id, coa_prioritecontenu, coa_typecontenu, coa_contenu)
VALUES (3, 6, 'Li gras', 'Réparations mécaniques et électriques, si nécessaire :');
INSERT INTO t_e_contenu_article_coa(art_id, coa_prioritecontenu, coa_typecontenu, coa_contenu)
VALUES (3, 6, 'Li',
        'nous remplaçons systématiquement les pièces d''usure qui ne sont pas dans un état équivalent au neuf (cav_pneus, patins de cav_freins, câbles et gaines, chaîne...), changeons ou ajustons les pièces mécaniques endommagées, et effectuons des diagnostics des composants électroniques.');
INSERT INTO t_e_contenu_article_coa(art_id, coa_prioritecontenu, coa_typecontenu, coa_contenu)
VALUES (3, 7, 'Li gras', 'Nettoyage et inspection finale :');
INSERT INTO t_e_contenu_article_coa(art_id, coa_prioritecontenu, coa_typecontenu, coa_contenu)
VALUES (3, 7, 'Li',
