INSERT INTO t_e_contenu_article_coa(art_id, coa_prioritecontenu, coa_typecontenu, coa_contenu)
VALUES (4, 0, 'Titre', 'Comprendre le prix d''un vélo électrique reconditionné');
INSERT INTO t_e_contenu_article_coa(art_id, coa_prioritecontenu, coa_typecontenu, coa_contenu)
VALUES (4, 1, 'Sous-Titre', 'Pourquoi nos prix sont-ils si attractifs ?');
INSERT INTO t_e_contenu_article_coa(art_id, coa_prioritecontenu, coa_typecontenu, coa_contenu)
VALUES (4, 2, 'Li lien', 'Nos canaux d''acquisition de vélos');
INSERT INTO t_e_contenu_article_coa(art_id, coa_prioritecontenu, coa_typecontenu, coa_contenu)
VALUES (4, 2, 'Li',
        'nous permettent de les acheter à des prix très compétitifs, et de répercuter ces économies sur vous');
INSERT INTO t_e_contenu_article_coa(art_id, coa_prioritecontenu, coa_typecontenu, coa_contenu)
VALUES (4, 3, 'Li',
        'Nous ne sommes pas contraints par les fabricants sur les prix de vente comme peuvent l''être des distributeurs classiques');
INSERT INTO t_e_contenu_article_coa(art_id, coa_prioritecontenu, coa_typecontenu, coa_contenu)
VALUES (4, 4, 'Li', 'Notre organisation opérationnelle nous permet de reconditionner les vélos de manière efficiente');
INSERT INTO t_e_contenu_article_coa(art_id, coa_prioritecontenu, coa_typecontenu, coa_contenu)
VALUES (4, 5, 'Sous-Titre', 'Comprendre l''affichage du prix sur notre site');
INSERT INTO t_e_contenu_article_coa(art_id, coa_prioritecontenu, coa_typecontenu, coa_contenu)
VALUES (4, 6, 'coa_contenu',
        'Chaque vélo dispose d''une page unique sur laquelle vous pouvez consulter toutes les informations spécifiques à ce vélo. Le prix rayé sur l''image ci-dessous représente le prix public conseillé de ce vélo pour son année de collection. Dans l''exemple ci-dessous, le E-Explorer 6.5 de la collection 2022 de Lapierre dans cette configuration était vendu neuf au prix de 3199€. Nous vérifions cette information avant la mise en ligne du vélo en consultant le site ou le catalogue du fabricant.');
INSERT INTO t_e_contenu_article_coa(art_id, coa_prioritecontenu, coa_typecontenu, coa_contenu)
VALUES (4, 7, 'Photo',
        'https://attachments.gorgias.help/x0oj/hc/k8pn/capture%20d%E2%80%99e%CC%81cran%202024-02-07%20a%CC%80%2011.13.08-fbd9160e-ae95-4e47-8fa0-512dc1565aac.png');
INSERT INTO t_e_contenu_article_coa(art_id, coa_prioritecontenu, coa_typecontenu, coa_contenu)
VALUES (4, 8, 'Legende', 'Vignette de prix présente sur la page de chaque vélo');
INSERT INTO t_e_contenu_article_coa(art_id, coa_prioritecontenu, coa_typecontenu, coa_contenu)
VALUES (4, 9, 'coa_contenu',
        'Le prix en noir situé à gauche de l''image (2399€ dans ce cas) est le prix auquel nous vendons ce vélo. Le pourcentage présenté en orange indique la remise dont vous bénéficiez par rapport au prix public conseillé. La remise dépend de nombreux paramètres, comme le kilométrage du vélo, son année, la demande des clients pour ce modèle, l''état de nos stocks, etc. Veuillez noter que le prix public conseillé d''un même modèle peut varier d''une année à l''autre, et qu''au sein d''une même collection, un modèle peut présenter différents prix en fonction des configurations (capacité de la batterie, accessoires additionnels...). Si vous avez la moindre question sur le prix public conseillé ou le prix de revente Upway d''un vélo, n''hésitez pas à ');
INSERT INTO t_e_contenu_article_coa(art_id, coa_prioritecontenu, coa_typecontenu, coa_contenu)
VALUES (4, 10, 'Lien', 'nous contacter !');


