        'Nous vous recommandons de bien conserver le carton et les protections du vélo, cela vous permettra de le remballer facilement. Si vous ne conservez pas le carton, il faudra vous en procurer au préalable (notre transporteur ne vous en fournira pas). La plupart des magasins de vélos se débarrassent des cartons vides après avoir reçu des vélos.');


INSERT INTO t_e_contenu_article_coa(art_id, coa_prioritecontenu, coa_typecontenu, coa_contenu)
VALUES (15, 0, 'Titre', 'Puis-je échanger mon vélo contre un autre ?');
INSERT INTO t_e_contenu_article_coa(art_id, coa_prioritecontenu, coa_typecontenu, coa_contenu)
VALUES (15, 1, 'coa_contenu',
        'Nous ne proposons malheureusement pas d''échanges automatiques pour le moment. Si vous souhaitez échanger votre vélo contre un autre, il faudra effectuer un retour du premier vélo contre remboursement, et commander séparément le second vélo. Notre équipe est disponible pour vous assister dans ces tâches !');


INSERT INTO t_e_contenu_article_coa(art_id, coa_prioritecontenu, coa_typecontenu, coa_contenu)
VALUES (16, 0, 'Titre', 'Comment fonctionne la garantie ?');
INSERT INTO t_e_contenu_article_coa(art_id, coa_prioritecontenu, coa_typecontenu, coa_contenu)
VALUES (16, 1, 'coa_contenu',
        'Vous venez ou planifiez d’acheter votre futur vélo électrique avec Upway ? Nous vous aidons à y voir clair sur vos garanties et sur la meilleure façon de protéger et entretenir votre vélo après votre achat.');
INSERT INTO t_e_contenu_article_coa(art_id, coa_prioritecontenu, coa_typecontenu, coa_contenu)
VALUES (16, 2, 'Sous-Titre', 'La garantie, en cas de panne');
INSERT INTO t_e_contenu_article_coa(art_id, coa_prioritecontenu, coa_typecontenu, coa_contenu)
VALUES (16, 3, 'coa_contenu',
        'Chez Upway, tous nos vélos sont inspectés et reconditionnés par nos mécaniciens professionnels selon un cahier des charges précis. Notre objectif : vous livrer un vélo électrique dans un état aussi proche que possible du neuf. Votre vélo');
INSERT INTO t_e_contenu_article_coa(art_id, coa_prioritecontenu, coa_typecontenu, coa_contenu)
VALUES (16, 3, 'coa_contenu lien', 'pourra aisément parcourir plusieurs dizaines de milliers de kilomètres');
INSERT INTO t_e_contenu_article_coa(art_id, coa_prioritecontenu, coa_typecontenu, coa_contenu)
VALUES (16, 3, 'coa_contenu', ' si vous l’entretenez régulièrement.');
INSERT INTO t_e_contenu_article_coa(art_id, coa_prioritecontenu, coa_typecontenu, coa_contenu)
VALUES (16, 4, 'Sous-Titre', 'Comment fonctionne la garantie ?');
INSERT INTO t_e_contenu_article_coa(art_id, coa_prioritecontenu, coa_typecontenu, coa_contenu)
VALUES (16, 5, 'coa_contenu',
        'Si une panne électrique ou mécanique survient durant la première année suivant votre achat, nous prendrons intégralement en charge la réparation ou, à défaut, le remplacement de votre vélo. Nous vous assistons 7 jours sur 7 pour établir un premier diagnostic à distance, puis vous dirigeons vers un vélociste proche de chez vous afin d’établir un devis et procéder aux réparations. ');
INSERT INTO t_e_contenu_article_coa(art_id, coa_prioritecontenu, coa_typecontenu, coa_contenu)
VALUES (16, 6, 'Sous-Titre', 'Quelles pannes sont couvertes par la garantie ?');
INSERT INTO t_e_contenu_article_coa(art_id, coa_prioritecontenu, coa_typecontenu, coa_contenu)
VALUES (16, 7, 'coa_contenu',
        'Vous êtes couverts si le vélo présente un défaut de fabrication, de reconditionnement ou si un défaut est apparu durant la livraison. Par exemple : l’assistance électrique ne fonctionne pas, l’écran affiche un code d’erreur, la batterie ne prend pas la charge, etc.');
INSERT INTO t_e_contenu_article_coa(art_id, coa_prioritecontenu, coa_typecontenu, coa_contenu)
VALUES (16, 8, 'Sous-Titre', 'Quels cas sont exclus de la garantie ?');
INSERT INTO t_e_contenu_article_coa(art_id, coa_prioritecontenu, coa_typecontenu, coa_contenu)
VALUES (16, 9, 'coa_contenu',
        'La garantie ne s’applique pas si la panne résulte d’un manque d’entretien, d’une mauvaise utilisation du vélo ou d’un accident. Elle ne couvre pas non plus les défauts des pièces d’usure résultant d’une utilisation normale du vélo. Par exemple : chaîne cassée, pneu crevé, plaquettes de frein usées, joint de cav_fourche perdant son étanchéité avec le temps, détérioration des roulements, rayons qui se détendent ou se cassent…');
INSERT INTO t_e_contenu_article_coa(art_id, coa_prioritecontenu, coa_typecontenu, coa_contenu)
VALUES (16, 10, 'Sous-Titre', 'Que se passe-t-il au-delà de la première année ?');
INSERT INTO t_e_contenu_article_coa(art_id, coa_prioritecontenu, coa_typecontenu, coa_contenu)
VALUES (16, 11, 'coa_contenu',
        'En tant que produit reconditionné, les vélos Upway disposent d’une garantie légale de conformité d’une durée de 2 ans à partir de la date de livraison. Durant la première année, vous n’avez pas à apporter la preuve de la date d’apparition du défaut. Passé ce délai, vous pouvez toujours mettre en œuvre la garantie durant la deuxième année suivant votre achat, mais c''est à vous d''apporter la preuve que le défaut ayant entraîné la panne existait au jour de votre achat. Nous préférons ainsi communiquer sur le fait que nous prendrons systématiquement en charge la réparation d’une panne avérée durant la première année.');


INSERT INTO t_e_contenu_article_coa(art_id, coa_prioritecontenu, coa_typecontenu, coa_contenu)
VALUES (17, 0, 'Titre', 'Puis-je prolonger ma période de garantie ?');
INSERT INTO t_e_contenu_article_coa(art_id, coa_prioritecontenu, coa_typecontenu, coa_contenu)
VALUES (17, 1, 'coa_contenu', 'Nous ne proposons pour le moment pas d''extension de garantie.');


INSERT INTO t_e_contenu_article_coa(art_id, coa_prioritecontenu, coa_typecontenu, coa_contenu)
VALUES (18, 0, 'Titre', 'Mon vélo est-il couvert par la garantie du fabricant du vélo ?');
INSERT INTO t_e_contenu_article_coa(art_id, coa_prioritecontenu, coa_typecontenu, coa_contenu)
VALUES (18, 1, 'coa_contenu',
        'La garantie Upway s''applique le vélo présente un défaut de fabrication, de reconditionnement ou si un défaut est apparu durant la livraison. Par exemple : l’assistance électrique ne fonctionne pas, l’écran affiche un code d’erreur, la batterie ne tient pas la charge, etc. La garantie constructeur peut s''appliquer en plus de la garantie Upway pour certains vélos de moins de 2 ans, n''hésitez donc pas à faire des recherches sur la politique de garantie du constructeur du vélo que vous souhaitez acquérir. ');
INSERT INTO t_e_contenu_article_coa(art_id, coa_prioritecontenu, coa_typecontenu, coa_contenu)
VALUES (18, 2, 'coa_contenu', 'Veuillez cependant noter que la prise en charge de cette ');
INSERT INTO t_e_contenu_article_coa(art_id, coa_prioritecontenu, coa_typecontenu, coa_contenu)
VALUES (18, 2, 'coa_contenu gras', 'garantie constructeur par les revendeurs peut s''avérer aléatoire');
INSERT INTO t_e_contenu_article_coa(art_id, coa_prioritecontenu, coa_typecontenu, coa_contenu)
VALUES (18, 2, 'coa_contenu',
        ' lorsque le vélo n''a pas été acheté chez eux. Certains l''appliquent, d''autres non, et nous ne pouvons donc pas garantir que tous les revendeurs accepteront votre demande de garantie constructeur.');


INSERT INTO t_e_contenu_article_coa(art_id, coa_prioritecontenu, coa_typecontenu, coa_contenu)
VALUES (19, 0, 'Titre', 'Comment fonctionne l''assurance vol et casse ?');
INSERT INTO t_e_contenu_article_coa(art_id, coa_prioritecontenu, coa_typecontenu, coa_contenu)
VALUES (19, 1, 'coa_contenu',
        'Conscients que le vol constitue l''un des principaux cav_freins à l''acquisition d''un vélo électrique, nous avons dét_e_velo_velppé un contrat d''assurance vol et casse dédié aux vélos électriques reconditionnés par Upway.');
INSERT INTO t_e_contenu_article_coa(art_id, coa_prioritecontenu, coa_typecontenu, coa_contenu)
VALUES (19, 2, 'Sous-Titre', 'Pourquoi protéger mon vélo électrique contre le vol ou la casse ?');
INSERT INTO t_e_contenu_article_coa(art_id, coa_prioritecontenu, coa_typecontenu, coa_contenu)
VALUES (19, 3, 'coa_contenu',
        'La plupart des contrats d’assurance habitation prévoient une couverture limitée du vélo. À l’intérieur de votre domicile, le vol par effraction est souvent couvert. À l’extérieur, il fait parfois l’objet d’une option spécifique.');
INSERT INTO t_e_contenu_article_coa(art_id, coa_prioritecontenu, coa_typecontenu, coa_contenu)
VALUES (19, 4, 'coa_contenu',
        'Une bonne protection contre le vol nous paraît nécessaire si votre vélo représente un certain budget et qu’il sera amené à stationner à l’extérieur (même en journée et pour de courtes durées) ou dans un local partagé (même sécurisé par un verrou). D’après ');
INSERT INTO t_e_contenu_article_coa(art_id, coa_prioritecontenu, coa_typecontenu, coa_contenu)
